import React from 'react';
import DoggoList from './DoggoList';

function DoggoApp () {
  return (
    <div className="container is-fluid">

      <DoggoList 
        doggoName="Shiba Inu aka Doge" 
        doggoAge="5" doggoId="J...546L" 
        doggoDescription="yes shiba inu is one of the cutest doggo in the world"
      />

    </div>
  );
}

export default DoggoApp;
